              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "expire_at": {
                      "type": "string",
                      "description": "The timestamp when the token expires"
                    },
                    "issued_at": {
                      "type": "string",
                      "description": "The timestamp when the token is issued"
                    },
                    "is_valid": {
                      "type": "boolean",
