                            "view_only",
                            "no_access"
                          ]
                        },
                        "feeds": {
                          "type": "string",
                          "enum": [
                            "full_access",
                            "view_only",
                            "no_access"
                          ]
                        },
                        "returns": {
                          "type": "string",
                          "enum": [
                            "full_access",
                            "view_only",
                            "no_access"
